import React, { useEffect, useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../../contexts/AuthContext';
import api from '../../services/api';
import { toast } from 'react-hot-toast';
import { FiHome, FiTruck, FiPackage, FiPlus, FiEdit2, FiTrash2, FiCalendar } from 'react-icons/fi';

const MyInterests = () => {
  const [interests, setInterests] = useState([]);
  const [loading, setLoading] = useState(true);
  const { user } = useAuth();
  const navigate = useNavigate();

  useEffect(() => {
    const fetchInterests = async () => {
      try {
        setLoading(true);
        const response = await api.interests.getMine();
        
        if (response && response.data) {
          // Handle both response formats for backward compatibility
          const interestsData = Array.isArray(response.data) 
            ? response.data 
            : (response.data.data || []);
          
          setInterests(interestsData);
          console.log('Fetched interests:', interestsData);
        } else {
          toast.error('Failed to load interests: Invalid response format');
          setInterests([]);
        }
      } catch (error) {
        console.error('Error fetching interests:', error);
        const errorMessage = error.response?.data?.message || 'Failed to fetch your interests';
        toast.error(errorMessage);
        setInterests([]);
      } finally {
        setLoading(false);
      }
    };

    if (user) {
      fetchInterests();
    }
  }, [user]);

  const getStatusBadge = (status) => {
    const statusMap = {
      pending: { bg: 'bg-yellow-100', text: 'text-yellow-800' },
      in_progress: { bg: 'bg-blue-100', text: 'text-blue-800' },
      completed: { bg: 'bg-green-100', text: 'text-green-800' },
      rejected: { bg: 'bg-red-100', text: 'text-red-800' }
    };
    
    const statusConfig = statusMap[status] || { bg: 'bg-gray-100', text: 'text-gray-800' };
    const displayStatus = status.split('_').map(word => 
      word.charAt(0).toUpperCase() + word.slice(1)
    ).join(' ');
    
    return (
      <span className={`px-2.5 py-0.5 rounded-full text-xs font-medium ${statusConfig.bg} ${statusConfig.text}`}>
        {displayStatus}
      </span>
    );
  };

  const getInterestIcon = (type) => {
    const iconClass = 'h-6 w-6';
    switch (type) {
      case 'house':
        return <FiHome className={`${iconClass} text-blue-600`} />;
      case 'car':
        return <FiTruck className={`${iconClass} text-green-600`} />;
      default:
        return <FiPackage className={`${iconClass} text-purple-600`} />;
    }
  };

  const getInterestDetails = (interest) => {
    const { priceRange, notes } = interest;
    const priceText = priceRange?.min || priceRange?.max 
      ? `$${priceRange.min?.toLocaleString() || '0'} - $${priceRange.max?.toLocaleString() || 'Any'}`
      : 'Price not specified';

    return (
      <div className="mt-1 space-y-1">
        <p className="text-sm text-gray-600">{notes || 'No additional details provided'}</p>
        <p className="text-sm font-medium text-gray-900">{priceText}</p>
      </div>
    );
  };

  const handleDelete = async (id) => {
    if (window.confirm('Are you sure you want to delete this interest?')) {
      try {
        await api.interests.delete(id);
        setInterests(interests.filter(interest => interest._id !== id));
        toast.success('Interest deleted successfully');
      } catch (error) {
        console.error('Error deleting interest:', error);
        toast.error(error.response?.data?.message || 'Failed to delete interest');
      }
    }
  };

  const formatDate = (dateString) => {
    return new Date(dateString).toLocaleDateString('en-US', {
      year: 'numeric',
      month: 'short',
      day: 'numeric',
      hour: '2-digit',
      minute: '2-digit'
    });
  };

  if (loading) {
    return (
      <div className="flex justify-center items-center min-h-[400px]">
        <div className="animate-spin rounded-full h-12 w-12 border-t-2 border-b-2 border-blue-500"></div>
      </div>
    );
  }

  return (
    <div className="max-w-6xl mx-auto px-4 py-8 sm:px-6 lg:px-8">
      <div className="sm:flex sm:items-center sm:justify-between mb-8">
        <div>
          <h1 className="text-2xl font-bold text-gray-900">My Interests</h1>
          <p className="mt-1 text-sm text-gray-600">View and manage your property interests</p>
        </div>
        <div className="mt-4 sm:mt-0">
          <Link
            to="/dashboard/interests/new"
            className="inline-flex items-center px-4 py-2 border border-transparent rounded-md shadow-sm text-sm font-medium text-white bg-blue-600 hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500"
          >
            <FiPlus className="-ml-1 mr-2 h-5 w-5" />
            New Interest
          </Link>
        </div>
      </div>

      {interests.length === 0 ? (
        <div className="bg-white shadow rounded-lg p-8 text-center">
          <FiPackage className="mx-auto h-12 w-12 text-gray-400" />
          <h3 className="mt-2 text-lg font-medium text-gray-900">No interests yet</h3>
          <p className="mt-1 text-sm text-gray-500">Get started by submitting a new interest.</p>
          <div className="mt-6">
            <Link
              to="/dashboard/interests/new"
              className="inline-flex items-center px-4 py-2 border border-transparent shadow-sm text-sm font-medium rounded-md text-white bg-blue-600 hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500"
            >
              <FiPlus className="-ml-1 mr-2 h-5 w-5" />
              New Interest
            </Link>
          </div>
        </div>
      ) : (
        <div className="bg-white shadow overflow-hidden sm:rounded-lg">
          <ul className="divide-y divide-gray-200">
            {interests.map((interest) => (
              <li key={interest._id} className="hover:bg-gray-50">
                <div className="px-4 py-5 sm:px-6">
                  <div className="flex items-center justify-between">
                    <div className="flex items-center">
                      <div className="flex-shrink-0">
                        {getInterestIcon(interest.type)}
                      </div>
                      <div className="ml-4">
                        <div className="flex items-center space-x-2">
                          <h3 className="text-lg font-medium text-gray-900 capitalize">
                            {interest.type} Interest
                          </h3>
                          {getStatusBadge(interest.status)}
                        </div>
                        {getInterestDetails(interest)}
                      </div>
                    </div>
                    <div className="ml-4 flex-shrink-0 flex space-x-2">
                      <button
                        onClick={() => navigate(`/dashboard/interests/${interest._id}/edit`)}
                        className="p-2 rounded-full text-gray-400 hover:text-blue-600 hover:bg-blue-50 focus:outline-none"
                        title="Edit interest"
                      >
                        <FiEdit2 className="h-5 w-5" />
                        <span className="sr-only">Edit</span>
                      </button>
                      <button
                        onClick={() => handleDelete(interest._id)}
                        className="p-2 rounded-full text-gray-400 hover:text-red-600 hover:bg-red-50 focus:outline-none"
                        title="Delete interest"
                      >
                        <FiTrash2 className="h-5 w-5" />
                        <span className="sr-only">Delete</span>
                      </button>
                    </div>
                  </div>
                  <div className="mt-3 flex items-center text-sm text-gray-500">
                    <FiCalendar className="flex-shrink-0 mr-1.5 h-4 w-4 text-gray-400" />
                    <p>
                      Submitted on {formatDate(interest.createdAt)}
                      {interest.updatedAt !== interest.createdAt && (
                        <span className="ml-2">
                          (Updated {formatDate(interest.updatedAt)})
                        </span>
                      )}
                    </p>
                  </div>
                </div>
              </li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
};

export default MyInterests;
